class User:
    def __init__(self, role):
        self.role = role

class FABSUser(User):
    def submit_data(self, data):
        print(f"FABS user submitted data: {data}")

class DABSUser(User):
    def view_dabs_pages(self):
        print("DABS user is viewing DABS pages")

class Developer(User):
    def update_fabs_sample_file(self, sample_file):
        print(f"Developer updated FABS sample file: {sample_file}")

    def add_gtas_window_data(self, data):
        print(f"Developer added GTAS window data: {data}")

    def test_system_functionality(self):
        print("Developer is testing system functionality")

class BrokerUser(User):
    def upload_error_messages(self, error_messages):
        print(f"Broker user uploaded error messages: {error_messages}")

    def validate_error_messages(self, error_messages):
        print(f"Broker user validated error messages: {error_messages}")

class UISME(User):
    def create_user_testing_summary(self, summary):
        print(f"UI SME created user testing summary: {summary}")

class SystemAdministrator(User):
    def validate_user_submitted_data(self, data):
        print(f"System administrator validated user-submitted data: {data}")

class FABS:
    def __init__(self):
        self.users = []

    def register_user(self, user):
        self.users.append(user)

    def submit_data(self, user, data):
        if isinstance(user, FABSUser):
            user.submit_data(data)
        else:
            print("Only FABS users can submit data")

    def view_dabs_pages(self, user):
        if isinstance(user, DABSUser):
            user.view_dabs_pages()
        else:
            print("Only DABS users can view DABS pages")

    def update_fabs_sample_file(self, user, sample_file):
        if isinstance(user, Developer):
            user.update_fabs_sample_file(sample_file)
        else:
            print("Only developers can update FABS sample file")

    def add_gtas_window_data(self, user, data):
        if isinstance(user, Developer):
            user.add_gtas_window_data(data)
        else:
            print("Only developers can add GTAS window data")

    def upload_error_messages(self, user, error_messages):
        if isinstance(user, BrokerUser):
            user.upload_error_messages(error_messages)
        else:
            print("Only broker users can upload error messages")

    def validate_error_messages(self, user, error_messages):
        if isinstance(user, BrokerUser):
            user.validate_error_messages(error_messages)
        else:
            print("Only broker users can validate error messages")

    def create_user_testing_summary(self, user, summary):
        if isinstance(user, UISME):
            user.create_user_testing_summary(summary)
        else:
            print("Only UI SMEs can create user testing summaries")

    def validate_user_submitted_data(self, user, data):
        if isinstance(user, SystemAdministrator):
            user.validate_user_submitted_data(data)
        else:
            print("Only system administrators can validate user-submitted data")

    def test_system_functionality(self, user):
        if isinstance(user, Developer):
            user.test_system_functionality()
        else:
            print("Only developers can test system functionality")

def main():
    fabs = FABS()

    fabs_user = FABSUser("FABS user")
    dabs_user = DABSUser("DABS user")
    developer = Developer("Developer")
    broker_user = BrokerUser("Broker user")
    ui_sme = UISME("UI SME")
    system_administrator = SystemAdministrator("System administrator")

    fabs.register_user(fabs_user)
    fabs.register_user(dabs_user)
    fabs.register_user(developer)
    fabs.register_user(broker_user)
    fabs.register_user(ui_sme)
    fabs.register_user(system_administrator)

    fabs.submit_data(fabs_user, "Test data")
    fabs.view_dabs_pages(dabs_user)
    fabs.update_fabs_sample_file(developer, "Updated sample file")
    fabs.add_gtas_window_data(developer, "GTAS window data")
    fabs.upload_error_messages(broker_user, ["Error message 1", "Error message 2"])
    fabs.validate_error_messages(broker_user, ["Error message 1", "Error message 2"])
    fabs.create_user_testing_summary(ui_sme, "User testing summary")
    fabs.validate_user_submitted_data(system_administrator, "User-submitted data")
    fabs.test_system_functionality(developer)

if __name__ == "__main__":
    main()
